// I make a table of characters in a friendly iterative/imperative manner

	function make_table(top_left) {

	top_left = parseInt(top_left);
	  /* 	  window.location=window.location+'#'+top_left; */
	  var i=0;
	  var table = '<table>';
	  height = 10;
	  width = 10;
	  while (i<height) {
	   table = table + '<tr>';

	   var j=0;
	   while (j<width) {
		 var no = top_left + (i * height) + j ;
		 table = table + '<td id="' + no +'"><a href="#'+no+'">&#' + no + ';<div class="exp"><a href="http://en.wikipedia.org/wiki/&#'+no+';">&amp;#'+no+';</a></div></td>';
		 j++;
	   }
	   table = table + '</tr>';
	   i++;
	 }

	   .mouseout(function(){

	}

	/* This determines where we are from the hash string AND modifies global variables. */

	function toSpot(hashString) {
	    var num_str = hashString.substring(1);
	    var pos = parseInt(num_str);

	    a = Math.floor(pos/10000);
	    //	    a = (a > 0) ? a : 0;

	    b = Math.floor((pos - a * 10000)/1000);
	    //b = (b>0) ? b : 0;

	    c = Math.floor(((pos - a * 10000) - (b * 1000))/100);
	    //c = (c>0) ? c : 0;

	    tl = Math.round(pos/100) * 100;

	    return tl;
	}

// Do we have a hash? 
	if (window.location.hash) {
	    the_top_left = toSpot(window.location.hash);
	}


// Make all the hrefs update the location with the hash, which makes it all bookmarkable

	$("#sliders a").click(function(){
